var AnotherAutoUpdater = { // update script by sizzlemctwizzle THANKS! http://userscripts.org/scripts/show/38017
 
	id: '73487', 
	days: 2, 
	name: /\/\/\s*@name\s+(.*)\s*\n/i.exec(scr_meta)[1],
	version: /\/\/\s*@version\s+(.*)\s*\n/i.exec(scr_meta)[1].replace(/\./g, ''),
	time: new Date().getTime(),
	call: function(response) {
		GM_xmlhttpRequest({
			method: 'GET',
			url: 'https://userscripts.org/scripts/source/'+this.id+'.meta.js',
			onload: function(xpr) {AnotherAutoUpdater.compare(xpr,response);}
		});
	},
	compare: function(xpr,response) {
		this.xversion=/\/\/\s*@version\s+(.*)\s*\n/i.exec(xpr.responseText);
		this.xname=/\/\/\s*@name\s+(.*)\s*\n/i.exec(xpr.responseText);
		if ( (this.xversion) && (this.xname[1] == this.name) ) {
			this.xversion = this.xversion[1].replace(/\./g, '');
			this.xname = this.xname[1];
		} else {
			if ( (xpr.responseText.match("the page you requested doesn't exist")) || (this.xname[1] != this.name) ) 
			GM_setValue('updated_'+this.id, 'off');
			return false;
		}
		if ( (+this.xversion > +this.version) && (confirm('A new version of the '+this.xname+' user script is available. Do you want to update?')) ) {
			GM_setValue('updated_'+this.id, this.time+'');
			top.location.href = 'https://userscripts.org/scripts/source/'+this.id+'.user.js';
		} else if ( (this.xversion) && (+this.xversion > +this.version) ) {
			if(confirm('Do you want to turn off auto updating for this script?')) {
				GM_setValue('updated_'+this.id, 'off');
				GM_registerMenuCommand("Auto Update "+this.name, function(){GM_setValue('updated_'+this.id, new Date().getTime()+''); AnotherAutoUpdater.call(true);});
				alert('Automatic updates can be re-enabled for this script from the User Script Commands submenu.');
			} else {
				GM_setValue('updated_'+this.id, this.time+'');
			}
		} else {
			if(response) alert('No updates available for '+this.name);
			GM_setValue('updated_'+this.id, this.time+'');
		}
	},
	check: function() {
		if (GM_getValue('updated_'+this.id, 0) == "off")
			GM_registerMenuCommand("Enable "+this.name+" updates", function(){GM_setValue('updated_'+this.id, new Date().getTime()+'');AnotherAutoUpdater.call(true)});
		else {
			if (+this.time > (+GM_getValue('updated_'+this.id, 0) + 1000*60*60*24*this.days)) {
			GM_setValue('updated_'+this.id, this.time+'');
			this.call();
		}
		GM_registerMenuCommand("Check "+this.name+" for updates", function(){GM_setValue('updated_'+this.id, new Date().getTime()+'');AnotherAutoUpdater.call(true)});
		}
	}
};

$(function(){
	AnotherAutoUpdater.check();
	var getResources = function(data) {
		var $recursos = $(data).find('#ressources').find('tbody tr:odd td').css('backgroundColor','#EEEEEE').end();
		$panel.empty().append($recursos);
		$('table#ressources th, table#ressources td').css('padding','2px 4px');
		$('table#ressources .lum, table#ressources .clay, table#ressources .iron, table#ressources .crop, table#ressources .tra').css('text-align','right');
		$('#panel #ressources thead tr:last-child td:last-child').empty().html('<img src="data:image/gif;base64,">');
		$trigger.text('Dorf3');
		$panel.slideToggle("fast");
	};	

	if (location.href.match(/manual/)) return;
	GM_addStyle(costumCss);
	$body = $('body');
	$body.append('<div id="panel"></div><a class="trigger" href="#">Dorf3</a>');
	$trigger = $('.trigger');
	$trigger.click(function(){
		$panel = $('#panel');
		$body.unbind('click.teste');
		if ($panel.is(':hidden')) {
			$trigger.text('Loading...').toggleClass('active');
			$.get('http://speed.travian.pt/dorf3.php?s=2', getResources);	
			$body.bind('click.teste',function (event) { 
				$panel.fadeOut('slow');
				$trigger.removeClass('active');
				$body.unbind('click.teste');
			});
		}
		else  {
			$panel.fadeOut("fast");
			$trigger.toggleClass("active");
		}
		return false;
	});
}); 